    NDVI = (NIR - R) / (NIR + R + 1e-12)
    return NDVI

def bumped_version(bump, current_version):

  major, minor, patch = current_version
  n_major, n_minor, n_patch = major, minor, patch
  if bump == 'major':
    n_major += 1
  elif bump == 'minor':
    n_minor += 1
  elif bump == 'patch':
    n_patch += 1
  return n_major, n_minor, n_patch

