def generate_decode_table(unique_signal_patterns):

    dt = {}  # decode table
    for signal in unique_signal_patterns:
        if len(signal) == 2:
            dt[1] = set(signal)
        elif len(signal) == 4:
            dt[4] = set(signal)
        elif len(signal) == 3:
            dt[7] = set(signal)
        elif len(signal) == 7:
            dt[8] = set(signal)

    # We already have 1, 4, 7, 8
    # find other codes
    for signal in unique_signal_patterns:
        length = len(signal)
        if length in (2, 4, 3, 7):
            continue

        signal = set(signal)
        if length == 6:
            if len(dt[1].difference(signal)) == 1:
                dt[6] = signal
            elif len(dt[4].difference(signal)) == 1:
                dt[0] = signal
            else:
                dt[9] = signal
        elif length == 5:
            if len(dt[1].difference(signal)) == 0:
                dt[3] = signal
            elif len(dt[4].difference(signal)) == 2:
                dt[2] = signal
            else:
                dt[5] = signal

    return dt

def binary_array_search(A, hi, target):

    lo = 0
    while lo <= hi:
        mid = (lo + hi) // 2

        diff = target - A[mid].priority
        if diff < 0:
            hi = mid-1
        elif diff > 0:
            lo = mid+1
        else:
            return mid

    return -(1+lo)

